class ElementFactory{static createHeader(){const e=document.createElement("header");return e.appendChild(this.createNavbar()),e}static createNavbar(){const e=document.createElement("nav");e.classList="navbar",e.ariaRoleDescription="Navigation bar";const t=document.createElement("h2");return t.innerText="Gposes",e.appendChild(t),e}static createSubHeader(e=""){const t=document.createElement("h3");return t.classList="folder",t.ariaRoleDescription=`Folder header ${e}`,t.innerText=e,t}static createRepository(e=[]){const t=document.createElement("div");return t.classList="repository",e.forEach(e=>{let o=this.createFolder(e);e.includes("/")&&(o=this.createFolder(e.split("/")[0])),t.appendChild(o)}),t}static createFolder(e=""){const t=document.createElement("div");t.classList="folder",t.appendChild(this.createSubHeader(e));const o=document.createElement("div");return o.classList="folder-content",o.id=`${e}Content`,t.appendChild(o),t}}class FetchFactory{static async fetchFolders(e){return await fetch(`${e}api/folders.php`).then(e=>e.json()).then(e=>{if(Object.keys(e).length>0)return document.body.appendChild(ElementFactory.createRepository(Object.keys(e))),Object.keys(e);console.error("No folder available !")}).catch(e=>console.error("Failed to fetch folders :",e.message))}static fetchFolderContent(e,t){console.log(e),console.log(t)}}const host="https://naslku.synology.me/_GposesAPI/";document.addEventListener("DOMContentLoaded",function(){document.body.appendChild(ElementFactory.createHeader()),FetchFactory.fetchFolders(host).then(e=>console.log(e))});